import * as React from 'react';
import Main from './components/MainComponent';
import {BrowserRouter} from 'react-router-dom';


function App() {
  return (
    <div className="App" id="outer-container"> {/* Corrected from outerContainerId to id */}
      <BrowserRouter>
      <Main/>
      </BrowserRouter>
    </div>
  );
}

export default App;
